import '../App.css';
import React, { useState, useEffect } from 'react';

class SettingsBar extends React.Component {
    constructor(props) {
        super(props);
    }

    render() {
        return(
            <div>
                {this.props.settingsvisible ? 
                    <div style={{display: 'flex'}}>
                        <div style={{height: '100vh', width: '17vw',backgroundColor: '#4495F6'}}>Settings Bar</div> 
                        <div style={{opacity: '1', width: '83vw', height: '100vh'}}></div>
                    </div>
                    : null }
            </div>
        )
    }
}

export default SettingsBar;
